import './Table.css';

function Table() {
  return (
    <div>
    <h1>Memo</h1>
    <table>
        <tr>
            <td>Date</td>
            <td>text</td>
            <td>
                <div>
                    <button>update</button>
                    <button>Delete</button>
                </div>
            </td>
        </tr>
    </table>
    </div>
  );
}

export default Table;
